#!/bin/python3
import time
'''
  To take a string as an input, check for two conditions:
  1. All of the characters are the same, e.g. aaa.
  2. All characters except the middle one are the same, e.g. aadaa.
  Count the no. of substrings which meet minimum one of these criteria.
  :param string: The input string
  :type string: str
  :return: Count of no. of substrings which satifies minimum one of the two conditions.
  :rtype: int
'''
def countSpecialStrings(string):
  str_len = len(string)
  count = str_len

  for i in range(0, str_len):
    for j in range(i+1, str_len):
      sub_string = string[i:j+1]
      str_set_len = len(set(sub_string))
      if(str_set_len == 1):
        count += 1
      elif(str_set_len > 2):
        break
      elif(string[i] == string[j]):
        length = len(sub_string)
        if(length % 2 == 0):
          continue
        middle = int(length/2)
        if(len(set(sub_string[0:middle])) != 1):
          break
        if(len(set(sub_string[middle+1:])) == 1 and sub_string[0] == sub_string[middle+1]):
          count += 1
      

  return count



string = ""
string_2 =""

start = time.process_time()
print("No. of special strings from the string: {}".format(countSpecialStrings(string_2)))
print("{} ms".format((time.process_time() - start) * 1000))
